                <i class="{{ nav.icon }}"></i>
              }
              <span> {{ nav.label }}</span>
            </li>
          } @else {
            @if (!$first) {
              <li>
                @if (nav.icon) {
                  <i class="{{ nav.icon }}"></i>
                }
                <a [routerLink]="[nav.path]"> {{ nav.label }}</a>
              </li>
            }
          }
        }
      }
    </ul>
  </nav>
